    static bool DoPathExistBetween(int r, int c, int endR, int endC, char[,] mat, char p, char s, bool isFound=false)
    {
        // Method to find whether there is a path between two given cells in given 
        // matrix
        
        // Parameters:
        // r = start row
        // c = start col
        // endR = end row
        // endC = end col
        // mat = matrix
        // p = passable cell character
        // s = searched cell character
        // isFound = true when end cell coordinates are found

        if(isFound)
        {
            return isFound;
        }

        if(r < 0 || c < 0 || r >= mat.GetLength(0) || c >= mat.GetLength(1) || mat[r,c] != p)
        {
            return isFound;
        }

        mat[r,c] = s; // Mark current cell as searched

        if(r == endR && c == endC)
        {
            isFound = true;
            return isFound;
        }

        isFound = DoPathExistBetween(r, c+1, endR, endC, mat, p, s, isFound); // search right
        isFound = DoPathExistBetween(r+1, c, endR, endC, mat, p, s, isFound); // search down
        isFound = DoPathExistBetween(r, c-1, endR, endC, mat, p, s, isFound); // search left
        isFound = DoPathExistBetween(r-1, c, endR, endC, mat, p, s, isFound); // search up
        
        return isFound;
    }


    static void PrintMatrix(char[,] mat)
    {
        // Method to print given matrix

        for(int r = 0; r < mat.GetLength(0); r++)
        {
            for(int c = 0; c < mat.GetLength(1); c++)
            {
                Console.Write(mat[r,c]);
            }

            Console.WriteLine();
        }
    }
